import { ParafinElements } from "@parafin/react-parafin-elements";

const App = () => {
  const [token, setToken] = useState(null);

  useEffect(() => {
    const fetchToken = async () => {      
      // Replace with your own Person ID
      const personId = "person_f27ccf05-aada-4348-bbcb-11ca672a8b59";

      // Fetch Parafin bearer token from server
      const response = await axios.get(`/parafin/token/${personId}`);

      setToken(response.data.parafinToken);
    };

    if (!token) {
      fetchToken();
    }    
  }, [token]); // Add token as a dependency to avoid infinite loop

  return (
    token && ( // Use parentheses instead of curly braces
      <ParafinElements
        product="capital"
        environment="production"
        token={token}        
      />
    )
  );
};

export default App;
